// Routes.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import WordSearch from './Views/WordSearch';


function Routes() {
    return (
        <Router>
            <Switch>
                <Route path="/wordsearch" component={WordSearch} />
            </Switch>
        </Router>
    );
}

export default Routes;
